import styled from "styled-components";

const Container = styled.div`
  margin-top: 76px;
  margin-bottom: 475px;
  background-color: purple;
  height: 600px;
`;

const Img = styled.img`
  object-fit: cover;
  width: auto;
  height: 100%;
`;

export { Container, Img };
